import React, {useState, useEffect} from 'react'
import {useNavigate} from 'react-router-dom'
import axios from 'axios'
import styled from 'styled-components'

const ContainerCard = styled.div`
display: flex;

`
const Card = styled.div`
border: 2px solid pink;
padding: 5px;
margin: 5px;
width: 200px;
`

const Botoes = styled.div`
display: flex;
justify-content: space-evenly;
`

export default function Viagens() {
  const navigate = useNavigate ()
  const [viagem, setViagem] = useState("")

  const voltar = () => {
    navigate(-1)
  }

  const vaiParaInscreverSe = () => {
    navigate("/cadastro")
  }

  const verViagem = () => {
    axios
    .get(`https://us-central1-labenu-apis.cloudfunctions.net/labeX/:lais/trips`)
    .then (res =>{
       setViagem(res.data.trips)
       console.log(res.data.trips)
    })
    .catch ( error => alert ('Erro'))
    }
  
    useEffect(() => {
    verViagem ()
       }, [])

  const cardViagem = viagem && viagem.map((viagem, index) => {
  
   return <Card key ={index}>
       <p>{viagem.name}</p>
       <p>{viagem.description}</p>
       <p>{viagem.planet}</p>
       <p>{viagem.duration}</p>
       <p>{viagem.date}</p>
       </Card>
  })

 
             
  return (
    <div>
      <Botoes>
        <button onClick={voltar}>Voltar</button>
        <button onClick={vaiParaInscreverSe}>Inscreva-se</button>
      </Botoes>  
     
      <ContainerCard>
      {cardViagem}
      </ContainerCard>
    
    </div>
  )
}
